import React from 'react';
import Posts from './Posts';


const Cardlist = ({rollData}) => {
 const b = rollData;

     return(

		<div >
		{
		rollData.map((user, i) => {
      	return (  
      		<Posts key={i} 
      		id={rollData[i].id} 
      		data={rollData[i].rolldata} 
      		date={rollData[i].rolldate}

            />

      	);

      })
     }
		 </div>
	);
}






export default Cardlist;
